def CalculateDistance(PointA,PointB):
    DistanceX = (PointA[1] - PointB[1]) * 111.320
    DistanceY = (PointA[2] - PointB[2]) * 111.320
    DistanceH = round(sqrt(DistanceX * DistanceX + DistanceY * DistanceY),4)
    return DistanceH

